const SpeakerListShort = ( {speakers}) => {
  

  return ( 
    
      <div className="speaker-list-short">
        
        {speakers.map((speaker) => (
          <div className="speaker-preview" key={speaker.id}>
            <Link to={ '/speakers/' + speaker.name }>
              <h2>{ speaker.name }</h2>
          
            </Link>



          </div>
        ))}
      </div>
      
   );
}
 
export default SpeakerListShort;
